    func testAttach_signature() throws {
        testAsyncMethods { (client, group) in
            group.enter()
            let tvcData: Data = self.generateAbiAndTvc("Events").tvc
            let abiJSONValue: AnyValue = self.generateAbiAndTvc("Events").abiJSON
            let abi: TSDKAbi = .init(type: .Serialized, value: abiJSONValue)
            let keys: TSDKKeyPair = .init(public: "4c7c408ff1ddebb8d6405ee979c716a14fdd6cc08124107a61d3c25597099499",
                                          secret: "cc8929d635719612a9478b9cd17675a39cfad52d8959e8a177389b8c0b9122a7")
            let signer: TSDKSigner = .init(type: .External,
                                           public_key: keys.public,
                                           keys: nil,
                                           handle: nil)
            let callSet: TSDKCallSet = .init(function_name: "constructor",
                                             header: TSDKFunctionHeader(expire: 1599458404,
                                                                        time: 1599458364291,
                                                                        pubkey: keys.public),
                                             input: nil)
            let deploySet: TSDKDeploySet = .init(tvc: tvcData, workchain_id: nil, initial_data: nil)
            let payload: TSDKParamsOfEncodeMessage = .init(abi: abi,
                                                           address: nil,
                                                           deploy_set: deploySet,
                                                           call_set: callSet,
                                                           signer: signer,
                                                           processing_try_index: nil)
            var dataToSign: String = .init()
            var messageEncodeMessage: String = .init()
            client.abi.encode_message(payload) { [group] (response) in
                XCTAssertTrue(response.result?.data_to_sign != nil)
                dataToSign = response.result?.data_to_sign ?? ""
                messageEncodeMessage = response.result?.message ?? ""
                group.leave()
            }
            group.wait()
            XCTAssertEqual(messageEncodeMessage, "")
            XCTAssertEqual(dataToSign, "KCGM36iTYuCYynk+Jnemis+mcwi3RFCke95i7l96s4Q=")

            group.enter()
            let payloadNaclSignKeyPair: TSDKParamsOfNaclSignKeyPairFromSecret = .init(secret: keys.secret)
            var naclSecret: String = .init()
            client.crypto.nacl_sign_keypair_from_secret_key(payloadNaclSignKeyPair) { [group] (response) in
                XCTAssertTrue(response.result?.secret != nil)
                naclSecret = response.result?.secret ?? ""
                group.leave()
            }
            group.wait()
            XCTAssertEqual(naclSecret, keys.secret + keys.public)

            group.enter()
            let payloadNaclSign: TSDKParamsOfNaclSign = .init(unsignedEncodedBase64: dataToSign, secret: naclSecret)
            var signature: String = .init()
            client.crypto.nacl_sign_detached(payloadNaclSign) { [group] (response) in
                XCTAssertTrue(response.result?.signature != nil)
                signature = response.result?.signature ?? ""
                group.leave()
            }
            group.wait()
            Log.log(signature)
            XCTAssertEqual(signature, "6272357bccb601db2b821cb0f5f564ab519212d242cf31961fe9a3c50a30b236012618296b4f769355c0e9567cd25b366f3c037435c498c82e5305622adbc70e")

            group.enter()
            let payloadAttachSignature: TSDKParamsOfAttachSignature = .init(abi: abi,
                                                                            public_key: keys.public,
                                                                            messageEncodedBase64: messageEncodeMessage,
                                                                            signature: signature)
            client.abi.attach_signature(payloadAttachSignature) { [group] (response) in
                XCTAssertEqual(response.result?.message, "")
                group.leave()
            }
            group.wait()
        }
    }

